import React from "react";

const newblock = {
    backgroundColor: "yellow",
    borderRadius: "50px",
    display: "block",
    width: "600px",
    height: "600px",
    marginLeft: "50px",
    marginTop: "30px",
    alignContent: "center"
}

export default class ItemFetchForm extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            itemList: [],
        }
    }

    componentDidMount() {
        fetch('http://localhost:8080/getItemList', {method: 'GET',})
            .then(res => res.json())
            .then(jsonResponse => {
                this.setState({
                    itemList: jsonResponse,
                })
                console.log("fetch was done")
                console.log(this.state)
                this.setState({dataFetched: true})
            })
            .catch(function(error) {
                console.log('There has been a problem with your fetch operation: ' + error.message);
                throw error;
            })
    }

    render(){
        return(<div style={newblock}>this is fetch Form <br/> this is state: <br/></div>)
    }
}
